#### Definitions

**1** Â  In this Act:

**"inspector"** means an inspector appointed under the [*Ministry of Agriculture and Food Act*](https://www.bclaws.gov.bc.ca/civix/document/id/complete/statreg/96296_01);

**"plant"** includes all members of the vegetable kingdom and a part or product of a plant;

**"treatment"** includes the application or manipulation of cultural, chemical or biological practices.

#### Powers and duties of inspectors

**3** Â  To carry out duties under this Act, an inspector may do one or more of the following:

(a) enter premises at any reasonable time for an inspection under this Act;

(b) inspect the premises, a plant, root medium or container;

(c) detain or order the detention of a plant, root medium or container;

(d) carry out or direct the carrying out of treatment;

(e) on the order of the minister, confiscate or destroy a plant, root medium or container;

(f) carry out other duties and exercise other powers prescribed in the regulations.

#### Regulations to prevent deleterious spreading

**8** Â  (1) In order to prevent the spread in British Columbia of an insect, pest or disease destructive to plants, the Lieutenant Governor in Council may make regulations referred to in sectionÂ 41 of the [*Interpretation Act*](https://www.bclaws.gov.bc.ca/civix/document/id/complete/statreg/96238_01).

(2) Without limiting subsection (1), the Lieutenant Governor in Council may make regulations as follows:

(a) prescribing the type or manner of treatment and who must carry it out;

(b) providing for collection, from the owner, of the expenses of treatment, and prescribing a method or system for that collection;

(c) prohibiting the sale or providing for the confiscation or destruction of a plant, root medium or container that is infested or infected or suspected of being infested or infected with an insect, pest or disease destructive to plants, or that is damaged by frost or otherwise injured;

(d) providing for reporting the discovery of a destructive insect, pest or disease and for obtaining and sending specimens;

(e) setting fees payable to the government for inspection or other service under the regulations;

(f) establishing quarantine areas in British Columbia and regulating or prohibiting the moving of a plant, root medium or container from or into a quarantine area.
